"     Therapeutic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Anti-inflammatory Agent",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Anti-inflammatory Agent, Rectal",
"      </span>",
"     </li>",
"     <li>",
