"       Corticosteroid, Rectal",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Corticosteroid, Topical",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Glucocorticoid",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block dos drugH1Div\" id=\"F10495727\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_general\" href=\"UTD.htm?20/54/21352?source=see_link\">",
"      see \"Hydrocortisone (topical): Drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Topical: Children and Adults: Usual: Apply 2-3 times/day (depending on severity); may be applied up to 4 times/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Rectal: Adolescents and Adults: Insert 1 application 1-2 times/day for 2-3 weeks",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Ulcerative colitis: One enema nightly for 21 days, or until remission occurs; clinical symptoms should subside within 3-5 days; discontinue use if no improvement within 2-3 weeks; some patients may require 2-3 months of therapy; if therapy lasts &gt;21 days, discontinue slowly by decreasing use to every other night for 2-3 weeks",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F8116386\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.  [DSC] = Discontinued product",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Aerosol, foam, rectal, as acetate:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Cortifoam&reg;: 10% (15 g) [90 mg/applicator]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical, as acetate: 1% (28.4 g, 454 g); 2% (43 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     U-Cort&reg;: 1% (28 g) [contains sodium metabisulfite]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical, as acetate [strength expressed as base]: 1% (30 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical, as base: 0.5% (28.4 g, 30 g); 1% (1 g, 1.5 g, 15 g, 28.4 g, 30 g, 114 g, 454 g); 2.5% (20 g, 28 g, 28.35 g, 30 g, 454 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Ala-Cort: 1% (28.4 g, 85.2 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Anusol-HC&reg;: 2.5% (30 g) [contains benzyl alcohol]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
