"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Lotion, topical, as base [kit]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Pediaderm&trade; HC: 2% (29.6 mL) [contains benzalkonium chloride, isopropyl alcohol; packaged with protective emollient]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Lotion, topical, as butyrate:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Locoid&reg;: 0.1% (60 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, topical, as acetate [strength expressed as base]: 1% (30 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, topical, as base: 0.5% (30 g); 1% (25 g, 30 g, 110 g, 430 g, 454 g); 2.5% (20 g, 30 g, 454 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
