"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Powder, for prescription compounding, as acetate [micronized]: USP: 100% (10 g, 25 g, 100 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, topical, as base:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Texacort&trade;: 2.5% (30 mL) [contains ethanol 48.8%]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
