"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Cortaid&reg; Intensive Therapy: 1% (59 mL) [contains ethanol 45%]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, topical, as butyrate: 0.1% (20 mL, 60 mL)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Locoid&reg;: 0.1% (20 mL, 60 mL) [contains isopropyl alcohol 50%]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Suppository, rectal, as acetate: 25 mg (12s); 30 mg (12s)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Anu-med HC: 25 mg (12s)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Anucort-HC&trade;: 25 mg (12s, 24s, 100s)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Anusol-HC&reg;: 25 mg (12s, 24s)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
