"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F8082170\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Dosages are expressed as the hydrochloride salt.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Allergic reactions or motion sickness:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Oral: 25-50 mg every 6-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     I.M., I.V.: 10-50 mg per dose; single doses up to 100 mg may be used if needed; not to exceed 400 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Antitussive:",
"     </b>",
"     Oral: 25 mg every 4 hours; maximum: 150 mg/24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Night-time sleep aid:",
"     </b>",
"     Oral: 50 mg at bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Dystonic reaction:",
"     </b>",
"     I.M., I.V.: 50 mg in a single dose; may repeat in 20-30 minutes if necessary",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F8082169\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_pediatric\" href=\"UTD.htm?18/48/19207?source=see_link\">",
"      see \"Diphenhydramine (systemic): Pediatric drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Dosages are expressed as the hydrochloride salt.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Allergic reactions or motion sickness:",
"     </b>",
"     Oral, I.M., I.V.: 5 mg/kg/day or 150 mg/m",
"     <sup>",
"      2",
"     </sup>",
"     /day in divided doses every 6-8 hours, not to exceed 300 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Alternate dosing by age:",
"     </i>",
"     Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     2 to &lt;6 years: 6.25 mg every 4-6 hours; maximum: 37.5 mg/day",
"    </p>",
"    <p style=\"text-indent:0em;margin-left:4em;text-align:justify;\">",
"     6 to &lt;12 years: 12.5-25 mg every 4-6 hours; maximum: 150 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     &ge;12 years: 25-50 mg every 4-6 hours; maximum: 300 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Night-time sleep aid:",
"     </b>",
"     Oral: Children &ge;12 years: 50 mg at bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Antitussive:",
"     </b>",
"     Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     2 to &lt;6 years: 6.25 mg every 4 hours; maximum: 37.5 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     6 to &lt;12 years: 12.5 mg every 4 hours; maximum: 75 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &ge;12 years: 25 mg every 4 hours; maximum: 150 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Treatment of dystonic reactions:",
"     </b>",
"     I.M., I.V.: 0.5-1 mg/kg/dose",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F8082171\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Initial: 25 mg 2-3 times/day increasing as needed",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F8082201\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Caplet, oral, as hydrochloride:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Aler-Dryl: 50 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     AllerMax&reg;: 50 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Anti-Hist: 25 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Compoz&reg;: 50 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Histaprin: 25 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Nytol&reg; Quick Caps: 25 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Simply Sleep&reg;: 25 mg [contains calcium 20 mg/caplet]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Sleep-ettes D: 50 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
