"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Diphenhist&reg;: 25 mg [contains calcium 45 mg/captab]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Elixir, oral, as hydrochloride:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Altaryl: 12.5 mg/5 mL (480 mL, 3840 mL) [ethanol free; cherry flavor]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
