"   <div class=\"block pha drugH1Div\" id=\"F8082131\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Competes with histamine for H",
"     <sub>",
"      1",
"     </sub>",
"     -receptor sites on effector cells in the gastrointestinal tract, blood vessels, and respiratory tract; anticholinergic and sedative effects are also seen",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F8082134\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Histamine-induced wheal suppression: &le;10 hours (Simons, 1990)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Histamine-induced flare suppression: &le;12 hours (Simons, 1990)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : Children: 22 L/kg (range: 15-28 L/kg); Adults: 17 L/kg (range: 13-20 L/kg); Elderly: 14 L/kg (range: 7-20 L/kg) (Blyden, 1986; Simons, 1990)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 98.5% (Vozeh, 1988)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic n-demethylation via CYP2D6; minor demethylation via  CYP1A2, 2C9 and 2C19; smaller degrees in pulmonary and renal systems; significant first-pass effect (Akutsu, 2007)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 42% to 62% (Paton, 1985)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Children: 5 hours (range: 4-7 hours); Adults: 9 hours (range: 7-12 hours); Elderly: 13.5 hours (range: 9-18 hours) (Blyden, 1986; Simons, 1990)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: ~2 hours (Blyden, 1986; Simons, 1990)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (as metabolites and unchanged drug) (Albert, 1975; Maurer, 1988)",
"    </p>",
"   </div>",
