" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of functional capacity in rheumatoid arthritis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I: Complete",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Ability to carry on all usual duties without handicaps",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class II: Adequate for normal activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Despite handicap of discomfort or limited motion at one or more joints",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class III: Limited",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Only to little or none of duties of usual occupation or self-care",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IV: Incapacitated, largely or wholly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;Bedridden or confined to wheelchairs; little or no self care",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
